    const dt = Intl.DateTimeFormat('pt-BR', { dateStyle: 'full' }).format(d)

    function loginRealizado(a) {
        if (a === "try") {
            document.getElementById('login--modal').showModal();
            document.getElementById('msg').innerHTML = "Verificando usuário e senha!"
        } else if (a === "successo") {
            setTimeout(() => {
                document.getElementById('msg').innerHTML = `Login realizado com sucesso! ${dt}`
            }, 3000)
        } else if (a === "incorreto") {
            setTimeout(() => {
                document.getElementById('msg').innerHTML = "Usuário ou senha incorreto."
            }, 3000)
        } else if (a === "erro") {
            setTimeout(() => {
                document.getElementById('msg').innerHTML = "Houve um erro ao tentar logar no servidor, tente novamente em alguns minutos."
            }, 3000)
        }
    }
    function fechaDiag() {
        let b = document.getElementById('msg').innerHTML
        if (b !== "Verificando usuário e senha!") {
            document.getElementById('login--modal').close();
        }
    }

    const LoginRealiza = () => {
        return (
            <>
                <dialog id='login--modal' onClick={fechaDiag}>
                    <div>
                        <p id='msg'></p>
                    </div>
                </dialog>
            </>
        )
    }

    const [login, setLogin] = React.useState();
    const [senha, setSenha] = React.useState();

    const Login = (e) => {
        e.preventDefault()
        loginRealizado("try")
        axios.get('http://localhost:3005/Logar', {
            params: {
                login: login,
                senha: senha
            }
        })
            .then((response) => {
                if (response.status === 200) {
                    if (!response.data) {
                        loginRealizado("incorreto")
                    } else {
                        console.log(response.data);
                        loginRealizado("successo")
                        setTimeout(() => {
                            console.log('teste')
                            window.location.href = "Dashboard";
                        }, 5000)
                        // axios.patch('http//localhost:3005/DataLogin', {
                        //     params: {
                        //         login: login,
                        //         senha: senha,
                        //         dataUltimoLogin: dt
                        //     }
                        // })
                    }
                }
            })
            .catch((err) => {
                console.log(err);
                loginRealizado("erro")
            })
            .finally(() => {
                document.getElementById('login--form').reset()
            })
    }

    return (
        <>
            <div className='title--bar'>
                <img className='crddrs' alt='crddrs' src={crddrs} />
                <h1>Conselho Regional dos Despachantes Documentalistas do Rio Grande do Sul</h1>
            </div>
            <div className='faixa--bar'>
                <div className='preto1'></div>
                <div className='verde'></div>
                <div className='vermelho'></div>
                <div className='amarelo'></div>
                <div className='preto2'></div>
            </div>
            <div className='faixa--bar space' style={{backgroundColor:"white"}}></div>
            <div className='nav--bar'>
                <nav className='nav--item'>
                    <p>Inicial</p>
                    <p>Sobre</p>
                </nav>
            </div>
            <div className='box--central'> 
            <div className='login'>
                    <h1>Login</h1>
                    <form id='login--form' onSubmit={Login}>
                        <div className='login-user'>
                            <TextField
                                id='login'
                                label='Usuário'
                                onChange={(e) => setLogin(e.target.value)}
                                color='success'
                                size='small'
                                fullWidth required />
                        </div>
                        <div className='login-user'>
                            <TextField
                                id='senha'
                                label='Senha'
                                type='password'
                                onChange={(e) => setSenha(e.target.value)}
                                color='success'

                                size='small'
                                fullWidth required />
                        </div>
                        <div className='login-user botao'>
                            <Button
                                variant='contained'
                                type='onSubmit'
                                color='success'
                                fullWidth>
                                Logar
                            </Button>
                        </div>
                        <p>Esqueci minha senha</p>
                    </form>
                    <LoginRealiza />
                </div>
                <div className='box--container'>
                    <h1>Confira os serviços disponíveis:</h1>
                    <div>
                        <div>
                            <h2>Alterações de Documento</h2>
                            <li>Alteração de Informações do Proprietário do Veículo</li>
                            <li>Alteração de Informações de Veículos</li>
                            <li>Alteração de Restrição Financeira</li>
                        </div>
                        <div>
                            <h2>Consultar Restrições</h2>
                            <li>Bloqueios DETRAN/RENAJUD</li>
                        </div>
                        <div>
                            <h2>Emissão de Documentos</h2>
                            <li>1º Emplacamento</li>
                            <li>Transferência de Proprietário</li>
                            <li>Transferência de Município/Estado</li>
                            <li>Transferência de Município</li>
                            <li>Alteração de Dados Cadastrais</li>
                            <li>Licenciamento</li>
                            <li>2ª Via de Licenciamento</li>
                            <li>Cópia de Certificado de Licenciamento</li>
                            <li>2ª Via de CRV</li>
                            <li>Comunicação de Vendas</li>
                            <li>Alteração de Endereço</li>
                        </div>
                        <div>
                            <h2>Processos</h2>
                            <li>Consultar Ficha Cadastral</li>
                            <li>Andamento do Processo</li>
                            <li>Status de Registro (Lote)</li>
                            <li>Impressão</li>
                            <li>Excluir Ficha Cadastral</li>
                            <li>Relatórios Acessos</li>
                            <li>Envio de Lote</li>
                        </div>
                        <div>
                            <h2>Consultar Veículos</h2>
                            <li>Base Estadual</li>
                            <li>Cadastro BIN/RENAVAM</li>
