                            <li>Transferência de Proprietário</li>
                            <li>Transferência de Município/Estado</li>
                            <li>Transferência de Município</li>
                            <li>Alteração de Dados Cadastrais</li>
                            <li>Licenciamento</li>
                            <li>2ª Via de Licenciamento</li>
                            <li>Cópia de Certificado de Licenciamento</li>
                            <li>2ª Via de CRV</li>
                            <li>Comunicação de Vendas</li>
                            <li>Alteração de Endereço</li>
                        </div>
                        <div>
                            <h2>Processos</h2>
                            <li>Consultar Ficha Cadastral</li>
                            <li>Andamento do Processo</li>
                            <li>Status de Registro (Lote)</li>
                            <li>Impressão</li>
                            <li>Excluir Ficha Cadastral</li>
                            <li>Relatórios Acessos</li>
                            <li>Envio de Lote</li>
                        </div>
                    </div>
                </div>
            </div>
            <footer>
